import React from 'react';
import FinanceStats from '../../components/FinanceStats';
import View from '../../components/View';
import Table from '../../components/Table';

const Dashboard = () => {
    const columns = [
        { label: 'Data', field: 'date' },
        { label: 'Histórico', field: 'history' },
        { label: 'Valor', field: 'amount' }
    ]

    const data = [
        { date: '2020-07-05', history: 'Compra de materiais de escritório', amount: '350000', status: 'active'},
        { date: '2020-07-15', history: 'Parcela Laptop 2/5', amount: '220182.46', status: 'active'},
        { date: '2020-06-23', history: 'Água', amount: '12010.5', status: 'inactive'},
        { date: '2020-05-18', history: 'Internet', amount: '9128.37', status: 'deleted'},
    ]

    return (
        <View
            title="Dashboard"
        >
            <FinanceStats />
            <Table
                mt={10}
                title="Contas a Pagar"
                columns={columns}
                data={data}
            />
        </View>
    )
}

export default Dashboard;
